// components/CustomButton.jsx
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';

const CustomButton = ({ to, children, variant = 'brown' }) => {

  const bgColor =
    variant === 'green'
      ? 'bg-green-600 hover:bg-green-500'
      : 'bg-brown_primary-dark hover:bg-brown_primary';

  return (
    <NavLink
      to={to}
      className={`${bgColor} p-2 w-48 text-center text-white text-2xl font-extralight rounded-sm transition-colors duration-200`}
    >
      {children}
    </NavLink>
  );
};


CustomButton.propTypes = {
  to: PropTypes.string.isRequired,
  children: PropTypes.node.isRequired,
  variant: PropTypes.oneOf(['brown', 'green']),
};

export default CustomButton;
